const FileData = (props) =>{
    let itemFile = props.file;
    let updatedFile = {}
    for (const record of itemFile){
        console.log(record,record['name'],updatedFile)
        let val=record['name'].toString()
        console.log(val,updatedFile,"outside if")
        if (updatedFile.val){
            console.log(updatedFile.val,val,'in if')
        }
        else{
        let val = String(record['name'])
        let obj={}
        obj[val]={
            batch:[record['batch']],
            stock:record["stock"],
            deal:record["deal"],
            free:record["free"],
            mrp:record["mrp"],
            rate:record["rate"],
            exp:record["exp"]}
        let newupdatedFile ={ ...obj,
                ...updatedFile
        }
        console.log(val,newupdatedFile);
        updatedFile= {...newupdatedFile};

         }
       
    };
}

export default FileData;
